Holidays are all about Family and Friends …. 
Sending love to you and yours … grateful for every day hope to see you in the water soon. ❤️🐶🤘🏼

Surf Dogs :
@skylerthesurfingdog 
@the_realrothstein

We wanted to announce today that @worlddogsurfing championships will be Skylers last Competition She has had such an illustrious career competitively we have had such an amazing journey helping push dog surfing to the next level. 
  We would like to thank all of our sponsors and all of our Amazing fans who have supported us along this journey … Skyler is almost 15 she’s doing good but slowing down a bit we figured it was time to let other dogs shine. We will only be competing in the dog/ human tandem part of the competition…. We still will be participating in our calling surf therapy helping others and sharing our passion for the Ocean & Surfing. 
Thanks again everyone for all the continued love and support …
Hope to see you at the beach rumor has it we might have a couple shirts for our super fans 

Also wanted to remind everyone to dream big ! Sky is the limit ! Believe and achieve … anything is possible ……..

